import React from 'react'
import { Link } from 'react-router-dom';

const Header = (props) => {
    return (
        <div>
            <nav className='navbar navbar-expand-lg bg-dark' style={{height: 60}}>
                
                <li className="nav-item active" style={{listStyleType: "none"}}> <Link style={{color:"white",textDecoration: "none", marginLeft: 30,marginRight: 30}}  to="/">Home</Link> </li>
                
                <li className="nav-item active" style={{listStyleType: "none"}}> <Link style={{color:"white",textDecoration: "none"}}  to="/issues"> Issues</Link></li>

                <li className='d-flex' style={{listStyleType: "none"}}> <Link style={{color:"white",textDecoration: "none", marginLeft: 30,marginRight: 30}}  to="/login">Login</Link></li>
            
            
            </nav>
            
        </div>
    )
}

export default Header
